import { combineReducers } from 'redux';

import auth from './auth/reducer';
import admin from './admin/reducer';
import homeCategory from './homeCategory/reducer';
import qBankMainCategory from './qBankMainCategory/reducer';
import DashboardCategory from './DashboardCategory/reducer';
import Coupon from './Coupon/reducer';
import Student from './Student/reducer';
import Testimonials from './Testimonials/reducer';
export default combineReducers({
    auth,
    admin,
    homeCategory,
    qBankMainCategory,
    DashboardCategory,
    Coupon,
    Student,
    Testimonials
});
